import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <h1>Hello Joseph</h1>
          <h2>God is good all the time and all the time God is good</h2>
          <h3>God is good all the time and all the time God is good</h3>
          <h3>God is good all the time and all the time God is good</h3>
          <h4>God is good all the time and all the time God is good</h4>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
